import Styles from './Login.module.css';
import login from '../../assets/login.png'; // Adjust the path as necessary

function Login() {
  return (
    <div>
        <div className={Styles.login__card}>
        <img src={login} alt=".."/>
        <h2>Login</h2>
            <div>
                
            </div>

        </div>
    </div>
  )
};

export default Login;
